import React, { useState, useEffect } from 'react'
import axios from 'axios'
import { useParams } from 'react-router-dom'
function DataFetingPhoto({ children }) {
  const [common, setCommon] = useState([0])
  const { id } = useParams

  useEffect(() => {
    axios
      .get(`http://localhost:3333/data/common/${id}`)
      .then(res => {
        setCommon(res.data)
      })
      .catch(err => {
        console.log(err)
      })
  }, [id])
  console.log(common)
  return (
    <div>
      <ul>
        {common.map((common, i) => (
          <li key={i} id={common.id}>
            {common.invited_people && common.invited_people.username[i]}
          </li>
        ))}
      </ul>
    </div>
  )
}

export default DataFetingPhoto
